INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (100, 10142, 1, 10.85, "エリコ", 0.0, "2024/03/31 12:00:00", 100, 7, 0.0, "訓練成功、おめでとうございます\n褒めるべき時にはしっかり褒めるのも\n教官の務めですものね。それとも、\n罵られる方が好みですか？　クスクス", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (101, 10142, 1, 11.15, "エリコ", 0.0, "2024/03/31 12:00:00", 101, 2, 0.0, "厳しい訓練も、終わってみれば\n短く感じるものですわね。\n正直、私は暴れ足りないくらい…\nいえ、何でもありませんわ。クスクス", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (102, 10142, 7, 6.4, "エリコ", 0.0, "2024/03/31 12:00:00", 102, 5, 0.0, "行く手を阻む忌々しい邪魔者を\n蹴散らして、見事ゴールイン…！\nまるで私とあのおかたの人生を\n象徴するような道のりでした…", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (103, 10142, 3, 0.0, "エリコ", 0.0, "2024/03/31 12:00:00", 103, 3, 0.0, "まったくもって不甲斐ない結果です\nしかし、挽回の機会はまだありますわ\n次はゴミ虫の地位から脱却できるよう\n死力を尽くしなさい。いいですね？", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (104, 10142, 2, 2.43, "エリコ", 0.0, "2024/03/31 12:00:00", 104, 8, 0.0, "クスクス…ああご心配なさらず\nなんとも情けない成績を残す輩には\nどんな罰が相応しいか、考えている\nだけですので…クスクスクス", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (105, 10142, 4, 9.08, "エリコ", 0.0, "2024/03/31 12:00:00", 105, 3, 0.0, "私が教官として認められなければ、\nあのおかたを失望させてしまう…\nそれだけはあってはなりません\nあなた方も、わかっていますわね？", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (106, 10142, 6, 0.0, "エリコ", 0.0, "2024/03/31 12:00:00", 106, 6, 0.0, "まずまずの結果ではありますが、\nこの程度で満足してもらっては\n困りますわ。エリコ班の一員として、\nより高みを目指していただきますので", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (107, 10142, 3, 10.6, "エリコ", 0.0, "2024/03/31 12:00:00", 107, 8, 0.0, "私の指導を受けながら、この結果は…\nもっと真剣に考えねばなりませんね\nあなた方が怠けずにいるには、\nどんなしつけが必要かを…クスクス", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (108, 10142, 6, 7.54, "エリコ", 0.0, "2024/03/31 12:00:00", 108, 4, 0.0, "ひとまず訓練をこなしたご褒美か、\n実力を出しきれたとは言えない罰か…\nみなさんにどちらを与えるべきか\n少し悩む結果ですわね", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (109, 10142, 2, 11.5, "エリコ", 0.0, "2024/03/31 12:00:00", 109, 7, 0.0, "なかなかいい戦いぶりでしたわ\nこれもあなた方の頑張りと、何より\n優秀な教官である私の教育の賜物\nそうですわね？　クスクスクス…", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (110, 10142, 2, 8.83, "エリコ", 0.0, "2024/03/31 12:00:00", 110, 1, 0.0, "これだけ進めたのならば合格点ですわ\nでも、もっと高みを目指したいと\n思っているのなら…さらなる訓練にも\n付き合って差し上げましょう", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (111, 10142, 1, 6.68, "エリコ", 0.0, "2024/03/31 12:00:00", 111, 2, 0.0, "未熟で頼りなかったあなた方が、\n見違えるように成長しました\nなるほど…これこそが、教官冥利に\n尽きるという気持ちなのですね", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (112, 10142, 6, 8.8, "エリコ", 0.0, "2024/03/31 12:00:00", 112, 2, 0.0, "まさかあなた方が、私の予想すら\n超える力を発揮するとは…驚きました\nもはやゴミ虫などではありません\n一人前の騎士として胸を張りなさい", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (113, 10142, 2, 8.9, "エリコ", 0.0, "2024/03/31 12:00:00", 113, 1, 0.0, "クスクス、見事な働きです\nみなさんならできると信じていました\n他でもない私の指導を受けた、\nエリコ班の優秀な新兵なのですから", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (114, 10142, 2, 3.7, "エリコ", 0.0, "2024/03/31 12:00:00", 114, 5, 0.0, "なんてすばらしい成績…！\n今日という日は『あのおかたを想い\nエリコが限界を超えた記念日』として\n歴史に刻まれることでしょう…！", "2030/12/17 14:59:59", 24, 129901);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (200, 10142, 1, 7.6, "マコト", 0.0, "2024/03/31 12:00:00", 200, 2, 0.0, "よし、いい訓練になったな\nおまえたちもよく動けてたし、\nちゃんと成長できてると思うぜ\nその調子で頑張れよっ", "2030/12/17 14:59:59", 24, 129801);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (201, 10142, 2, 2.25, "マコト", 0.0, "2024/03/31 12:00:00", 201, 1, 0.0, "ひとまずゴールおめでとう！\nでも、努力は継続してこそだからな\nおまえたちにやる気があるなら、\n何度だって付き合ってやるよ", "2030/12/17 14:59:59", 24, 129801);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (202, 10142, 2, 3.28, "マコト", 0.0, "2024/03/31 12:00:00", 202, 1, 0.0, "行軍訓練はこれにて完了！\n…なーんて思ってないよな？\n学んだことが体に染みつくまで\n地道に繰り返すのが練習ってもんさ", "2030/12/17 14:59:59", 24, 129801);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (203, 10142, 4, 2.98, "マコト", 0.0, "2024/03/31 12:00:00", 203, 1, 0.0, "みんなに無理をさせちまったか…\nでもこれで諦めることはないぜ\n次はきっとうまくいく。そう信じて\n鍛え続ければ、道は開けるはずだ！", "2030/12/17 14:59:59", 24, 129801);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (204, 10142, 4, 3.0, "マコト", 0.0, "2024/03/31 12:00:00", 204, 1, 0.0, "こいつは悔しい結果だな…\nま、反省点はいろいろあったし\nひとつずつ乗り越えていこう\nあたしたちで力を合わせて、なっ！", "2030/12/17 14:59:59", 24, 129801);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (205, 10142, 1, 10.3, "マコト", 0.0, "2024/03/31 12:00:00", 205, 2, 0.0, "おまえたちはまだ未熟な訓練兵、\n失敗を必要以上に悔やむことはねえよ\nでも実戦じゃこうはいかないからな\n次は気合を入れ直していけよっ！", "2030/12/17 14:59:59", 24, 129801);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (206, 10142, 6, 2.93, "マコト", 0.0, "2024/03/31 12:00:00", 206, 1, 0.0, "これがおまえたちの全力？\nいやいや、そんなはずはないよなっ\nおまえらならもっと強くなれる！\nあたしが言うんだ、間違いないぜ！", "2030/12/17 14:59:59", 24, 129801);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (207, 10142, 3, 9.3, "マコト", 0.0, "2024/03/31 12:00:00", 207, 1, 0.0, "おまえたちの実力を考えりゃ、\nベストを尽くせたとは言えない成績だ\nなら、次やるべきことも決まってる\n気持ちを切り替えて、鍛え直すんだ！", "2030/12/17 14:59:59", 24, 129801);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (208, 10142, 4, 6.9, "マコト", 0.0, "2024/03/31 12:00:00", 208, 1, 0.0, "まだまだ課題がある内容だったな～\n無駄な動き、判断の遅れ…\nそういうのをしっかり直していけば、\n記録ももっと伸びるはずだっ", "2030/12/17 14:59:59", 24, 129801);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (209, 10142, 2, 0.0, "マコト", 0.0, "2024/03/31 12:00:00", 209, 2, 0.0, "ここまでいけりゃ、合格点！\nむしろ、最初の頼りなさを思えば\nすげえ成長してるんじゃねえか？\n胸を張れる結果だと思うぜっ！", "2030/12/17 14:59:59", 24, 129801);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (210, 10142, 1, 5.95, "マコト", 0.0, "2024/03/31 12:00:00", 210, 2, 0.0, "なかなかハードな訓練だったけど、\nみんなしっかりついてこられたな\n地道に続けた基礎トレの成果が\n形になってる、その証だぜっ", "2030/12/17 14:59:59", 24, 129801);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (211, 10142, 2, 6.73, "マコト", 0.0, "2024/03/31 12:00:00", 211, 1, 0.0, "今回の訓練もよく頑張ったな！\nしっかり休んで次に備えろよ！\nなんつーか、教え子が成長してくのを\n見るのは楽しいもんだな…", "2030/12/17 14:59:59", 24, 129801);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (212, 10142, 2, 0.0, "マコト", 0.0, "2024/03/31 12:00:00", 212, 2, 0.0, "おまえら、すげえじゃねえか！\nこれならもう、ひよっこ新兵なんて\n言えねえな。きっと騎士団でも\n大活躍間違いなしだぜ！", "2030/12/17 14:59:59", 24, 129801);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (213, 10142, 1, 6.65, "マコト", 0.0, "2024/03/31 12:00:00", 213, 2, 0.0, "敵との戦い方、状況判断の正確さ\n何より根性…どれも最高だったぞ！\nうかうかしてたら、教官のあたしまで\n追い抜かれちまうかもな…へへっ", "2030/12/17 14:59:59", 24, 129801);
INSERT INTO `v1_1f3ed0bf56f6bf2dece0b2e118fc681f190cb21d2d20b1a729553d63998e603c` VALUES (214, 10142, 6, 3.05, "マコト", 0.0, "2024/03/31 12:00:00", 214, 1, 0.0, "あたしの指導が良かった？\nいやいや、ここまで強くなれたのは、\n他でもないおまえたち自身が努力した\nおかげだよ。改めて…おめでとうっ！", "2030/12/17 14:59:59", 24, 129801);
